import React from 'react';
import img1 from '../Components/images/1.jpg';

const Card = props =>{
  return(
    <div className='card text-center'>
    <div className='overFlow'>
      <img src={img1} alt="Image 1" />
      
      </div> 
    </div> 

  );
}

export default Card;
